import React from 'react';
//import {Link} from 'react-router-dom';
import { Box } from '@mui/material';
import AppMenu from './AppMenu';
import { useHistory } from 'react-router';
import { Button } from '@mui/material';

export default function Main() {
const history = useHistory();
const handleClick = function(link){
  history.push(link);
}

  return (
    <Box>
      <Button variant="contained" color="primary" onClick={()=>handleClick("/product")}>Product</Button>
      <Button variant="contained"  onClick={()=>handleClick("/employee")}>Employee</Button>
      <Button   onClick={()=>handleClick("/page")}>Page</Button>
    </Box>
  )
}
